import axios from "axios";

const feature = (url, method, type = "json") => {
  return new Promise(() => {
    switch (method) {
      case "get":
        break;
      case "post":
        console.log("get");
        break;
      case "put":
        console.log("get");
        break;
      case "delete":
        console.log("get");
        break;
      default:
        console.log("not");
        break;
    }
  });
};

export default feature;
